import "../css/characters.css";

export function DefaultCharacterCircle(props) {

  const characterEye = {
    width: "5px",
  height: "2px",
  backgroundColor: "black"
  }

  const characterEyes = {
    top: "14px",
    gap: "10px"
  }

  const characterMouth = {
    width: "10px",
    height: "2px",
    backgroundColor: "black",
    top: "25px",
    left: "50%",
    transform: "translateX(-50%)"
  }

  const characterEyebrows = {
    position: "absolute",
    display: "flex",
    justifyContent: "center",
    top: "10px",
    gap: "6px",
    left: "50%",
    transform: "translateX(-50%)"
  }

  let characterEyebrow = {
    width: "7px",
    height: "2px",
    backgroundColor: "black"
  }

  return (
    <div className="character-main-container">
      <div className="character-hat">{props.hat}</div>
      <div className="character-head">
        <div style={characterEyebrows} className="character-eyebrows">
          <div style={characterEyebrow} className="character-eyebrow"></div>
          <div style={characterEyebrow.append("")} className="character-eyebrow"></div>
        </div>
        <div style={characterEyes} className="character-eyes">
          <div style={characterEye}></div>
          <div style={characterEye}></div>
        </div>
        <div style={characterMouth} className="character-mouth"></div>
        <div className="character-glasses">{props.glasses}</div>
      </div>
      <div className="character-body"></div>
    </div>
  );
}
